INSERT INTO `blog` (`id`, `title`, `short_description`, `description`, `thumbnail`, `status`, `slug`) VALUES
(1, 'Financial Leasen met Billionaire cars', 'Een auto gevonden en wat nu? Billionaire cars biedt mogelijkheden zoals huurkoop, doorlopend krediet of een persoonlijke lening. Alles ingericht naar jouw persoonlijke wensen en financiële situatie. En om het allemaal nog wat makkelijker te maken word het op één locatie geregeld. Wat heb ik nodig om een auto te kunnen financieren?', '<ul><li>Vast contract of Tijdelijk contract met werkgeversverklaring</li><li>Loonstrook (laatste 3 maanden)</li><li>Kopie Identiteitsbewijs</li><li>Bankafschrift (1 volledige kalendermaand)<br></li></ul>', '1702024386-6016251.jpeg', 1, 'financial-leasen-met-billionaire-cars'),
(2, 'Persoonlijke Financiering met Billionaire Cars', 'Een auto gevonden en wat nu? Billionaire cars biedt mogelijkheden zoals huurkoop, doorlopend krediet of een persoonlijke lening. Alles ingericht naar jouw persoonlijke wensen en financiële situatie. En om het allemaal nog wat makkelijker te maken word het op één locatie geregeld. Wat heb ik nodig om een auto te kunnen financieren?', '<ul><li>Vast contract of Tijdelijk contract met werkgeversverklaring</li><li>Loonstrook (laatste 3 maanden)</li><li>Kopie Identiteitsbewijs</li><li>Bankafschrift (1 volledige kalendermaand)<br></li></ul>', '1702024386-6016251.jpeg', 1, 'persoonlijke-financiering-met-billionaire-cars'),
(3, 'Appointment for the Billionaire car plan', 'Een auto gevonden en wat nu? Billionaire cars biedt mogelijkheden zoals huurkoop, doorlopend krediet of een persoonlijke lening. Alles ingericht naar jouw persoonlijke wensen en financiële situatie. En om het allemaal nog wat makkelijker te maken word het op één locatie geregeld. Wat heb ik nodig om een auto te kunnen financieren?', '<ul><li>Vast contract of Tijdelijk contract met werkgeversverklaring</li><li>Loonstrook (laatste 3 maanden)</li><li>Kopie Identiteitsbewijs</li><li>Bankafschrift (1 volledige kalendermaand)<br></li></ul>', '1702024386-6016251.jpeg', 1, 'billionaire-auto-plan');

